import '../shared.css';
import React from 'react';
// import './MeetTeam.css';  // Import the page-specific styles for Meet Team

const MeetTeam: React.FC = () => {
  const teamMembers = [
    {
      name: 'Alec Naidoo',
      linkedin: 'https://www.linkedin.com/in/alec-naidoo/',
      image: '/images/alec.jpg',  // Replace with actual image paths
    },
    {
      name: 'Madison Fields',
      linkedin: 'https://www.linkedin.com/in/madison-fields-401b48139/',
      image: '/images/madison.jpg',
    },
    {
      name: 'Shruti Jain',
      linkedin: 'https://www.linkedin.com/in/shrutijain29/',
      image: '/images/shruti.jpg',
    },
    {
      name: 'Trisha Sanghal',
      linkedin: 'https://www.linkedin.com/in/trishasanghal/',
      image: '/images/trisha.jpg',
    },
  ];

  return (
    <div className="meet-team-container">
      <h2 className="team-title">Meet the Team</h2>
      <div className="team-grid">
        {teamMembers.map((member, index) => (
          <div key={index} className="team-member">
            <img src={member.image} alt={member.name} className="team-image" />
            <div className="team-info">
              <p className="team-name">{member.name}</p>
              <a href={member.linkedin} target="_blank" rel="noopener noreferrer" className="team-linkedin">
                LinkedIn
              </a>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default MeetTeam;
